DROP TABLE IF EXISTS `v_maintenance_schedule`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_maintenance_schedule` AS SELECT `inventory`.`inv_id` AS `inv_id`, `inventory`.`inv_department` AS `inv_department`, `rm`.`rm_date` AS `rm_date`, `inventory`.`psched_code` AS `psched_code`, `inventory`.`inv_unit` AS `inv_unit`, if((`inventory`.`psched_code` = 'SA'),(`rm`.`rm_date` + interval 6 month),if((`inventory`.`psched_code` = 'DY'),(`rm`.`rm_date` + interval 1 day),if((`inventory`.`psched_code` = 'WY'),(`rm`.`rm_date` + interval 1 week),if((`inventory`.`psched_code` = 'MY'),(`rm`.`rm_date` + interval 1 month),(`rm`.`rm_date` + interval 1 year))))) AS `SCHEDULE` FROM (`rm` left join `inventory` on((`rm`.`inv_id` = `inventory`.`inv_id`))) WHERE (year(`rm`.`rm_date`) = year(curdate())) ORDER BY `rm`.`rm_date` ASC ;

DROP TABLE IF EXISTS `v_preventive_maintenance`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_preventive_maintenance` AS SELECT `v_maintenance_schedule`.`inv_id` AS `ITEM`, `v_maintenance_schedule`.`inv_unit` AS `UNIT`, `v_maintenance_schedule`.`inv_department` AS `DEPARTMENT`, if((`v_maintenance_schedule`.`psched_code` = 'SA'),'SEMI-ANNUALLY',if((`v_maintenance_schedule`.`psched_code` = 'DY'),'DAILY',if((`v_maintenance_schedule`.`psched_code` = 'WY'),'WEEKLY',if((`v_maintenance_schedule`.`psched_code` = 'MY'),'MONTHLY','ANNUALLY')))) AS `FREQUENCY`, date_format(`v_maintenance_schedule`.`rm_date`,'%b %d, %Y') AS `LAST`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 1),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `JANUARY`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 2),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `FEBRUARY`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 3),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `MARCH`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 4),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `APRIL`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 5),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `MAY`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 6),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `JUNE`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 7),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `JULY`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 8),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `AUGUST`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 9),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `SEPTEMBER`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 10),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `OCTOBER`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 11),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `NOVEMBER`, if((month(`v_maintenance_schedule`.`SCHEDULE`) = 12),date_format(`v_maintenance_schedule`.`SCHEDULE`,'%b %d'),'-') AS `DECEMBER` FROM `v_maintenance_schedule` WHERE (year(`v_maintenance_schedule`.`SCHEDULE`) = year(curdate())) ;

DROP TABLE IF EXISTS `v_request_list`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_request_list` AS select `icto`.`service_log`.`sl_id` AS `sl_id`,`icto`.`service_log`.`sl_date` AS `sl_date`,`icto`.`service_log`.`userx_id` AS `userx_id`,`icto`.`service_log`.`sl_action` AS `sl_action`,`icto`.`service_log`.`sl_status` AS `sl_status`,`icto`.`service_log`.`sl_key` AS `sl_key`,substring_index(`icto`.`service_log`.`sl_id`,'_',-(1)) AS `index_num`,to_days(curdate()) - to_days(`icto`.`service_log`.`sl_date`) AS `sl_day`,hour(timediff(current_timestamp(),`icto`.`service_log`.`sl_date`)) AS `sl_hour`,minute(timediff(current_timestamp(),`icto`.`service_log`.`sl_date`)) AS `sl_minute` from (`icto`.`service_log` join (select `icto`.`service_log`.`sl_id` AS `sl_id`,max(`icto`.`service_log`.`sl_key`) AS `M` from `icto`.`service_log` group by `icto`.`service_log`.`sl_id`) `max_user`) where `icto`.`service_log`.`sl_id` = `max_user`.`sl_id` and `icto`.`service_log`.`sl_key` = `max_user`.`M` and `icto`.`service_log`.`sl_status` <> 'RESOLVED' order by `icto`.`service_log`.`sl_key` ;

DROP TABLE IF EXISTS `v_request_update`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_request_update` AS select `v_request_list`.`sl_id` AS `sl_id`,`v_request_list`.`sl_date` AS `sl_date`,`v_request_list`.`userx_id` AS `userx_id`,`v_request_list`.`sl_action` AS `sl_action`,`v_request_list`.`sl_status` AS `sl_status`,`v_request_list`.`sl_key` AS `sl_key`,if(`v_request_list`.`sl_day` > 0,concat(`v_request_list`.`sl_day`,' days ago'),if(`v_request_list`.`sl_hour` > 0,concat(`v_request_list`.`sl_hour`,' hours ago'),if(`v_request_list`.`sl_minute` > 0,concat(`v_request_list`.`sl_minute`,' minutes ago'),'a few seconds ago'))) AS `TIMER`,substr(`v_request_list`.`sl_id`,1,2) AS `Service`,`v_request_list`.`index_num` AS `index_num` from `icto`.`v_request_list` ;

